Ext.data.JsonP['CVS']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>CVS</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-30083196\" class=\"content\">\n                        <h1>CVS</h1>\n    <div class=\"section section-2 \" id=\"src-30083196_CVS-Contents\">\n        <h2 class=\"heading \"><span>Contents</span></h2>\n    <p>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/CVS-section-src-30083196_CVS-CVSSupport\">CVS Support</a>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/CVS-section-src-30083196_CVS-EclipseCVSFunctionality\">Eclipse CVS Functionality</a>    </p>\n</li></ul></li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/CVS-section-src-30083196_CVS-ImportorCheckoutanCVSRespository\">Import or Checkout an CVS Respository</a>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/CVS-section-src-30083196_CVS-UtilizetheCVSPerspective\">Utilize the CVS Perspective</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/CVS-section-src-30083196_CVS-AdditionalCVSQuestions\">Additional CVS Questions</a>    </p>\n</li></ul></li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-30083196_CVS-CVSSupport\">\n        <h2 class=\"heading \"><span>CVS Support</span></h2>\n    <p>The Studio uses the <a class=\"external-link external-link\" href=\"http://www.eclipse.org/eclipse/platform-cvs/\" target=\"_blank\">Eclipse CVS</a> to provide CVS support.    </p>\n    <p>When updating or adding Eclipse plugins or software, the software repository varies with the version of Studio:    </p>\n    <div class=\"tablewrap\">\n        <table class=\"confluenceTable\">\n        <thead class=\" \">    <tr>\n            <td class=\"confluenceTh\" rowspan=\"1\" colspan=\"1\">\n        <p>Appcelerator/Titanium Studio Version    </p>\n            </td>\n                <td class=\"confluenceTh\" rowspan=\"1\" colspan=\"1\">\n        <p>Eclipse Repository Name    </p>\n            </td>\n                <td class=\"confluenceTh\" rowspan=\"1\" colspan=\"1\">\n        <p>Eclipse Version    </p>\n            </td>\n        </tr>\n</thead><tfoot class=\" \"/><tbody class=\" \">    <tr>\n            <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>2.1.x    </p>\n            </td>\n                <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>Helios    </p>\n            </td>\n                <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>3.6    </p>\n            </td>\n        </tr>\n    <tr>\n            <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>3.0.x - 3.1.3    </p>\n            </td>\n                <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>Indigo    </p>\n            </td>\n                <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>3.7    </p>\n            </td>\n        </tr>\n    <tr>\n            <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>3.1.4 - 3.4.x    </p>\n            </td>\n                <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>Kepler    </p>\n            </td>\n                <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>4.3    </p>\n            </td>\n        </tr>\n    <tr>\n            <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>4.0.0 - latest    </p>\n            </td>\n                <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>Luna    </p>\n            </td>\n                <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>4.4    </p>\n            </td>\n        </tr>\n</tbody>        </table>\n            </div>\n    <p><strong class=\" \">Please ask your Confluence administrator to update the license for the  <a class=\"external-link external-link\" href=\"https://plugins.atlassian.com/plugins/biz.artemissoftware.confluence.multiexcerpt.MultiExcerptMacro\" target=\"_blank\"> MultiExcerpt Plugin for Confluence 4+ </a> .</strong><br><strong class=\" \">Admin Info:  The error is: license VERSION_MISMATCH</strong>    </br></p>\n    <p>    <span style=\"color: #000000;\">\nInstallation    </span>\n    </p>\n    <p>In case you installed the Studio as a plugin to eclipse distribution, CVS is already bundled and ready to be used. In any other case, follow these instructions to install the CVS support.    </p>\n<ul class=\" \"><li class=\" \">    <p>Open the Studio&apos;s preferences and locate the &apos;Available Software Sites&apos; page.    </p>\n</li><li class=\" \">    <p>Make sure that the main Eclipse update site is checked &apos;on&apos;. In this example, the update site is the Eclipse &apos;Helios&apos; site. Click &apos;OK&apos; to commit any changes made to this page and exit.    </p>\n    <div class=\"tablewrap\">\n        <table class=\"confluenceTable\">\n        <thead class=\" \"/><tfoot class=\" \"/><tbody class=\" \">    <tr>\n            <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>    <img src=\"images/download/attachments/30083196/update_sites.jpg\" alt=\"images/download/attachments/30083196/update_sites.jpg\" class=\"confluence-embedded-image image-left\">\n        </img></p>\n            </td>\n        </tr>\n</tbody>        </table>\n            </div>\n</li><li class=\" \">    <p>Click <strong class=\" \">Help</strong> -&gt; <strong class=\" \">Install New Software</strong>and select the Eclipse update site. It may take a couple of minutes to populate the plugin options.    </p>\n    <div class=\"tablewrap\">\n        <table class=\"confluenceTable\">\n        <thead class=\" \"/><tfoot class=\" \"/><tbody class=\" \">    <tr>\n            <td class=\"confluenceTd\" rowspan=\"1\" colspan=\"1\">\n        <p>    <img src=\"images/download/attachments/30083196/cvs_install.jpg\" alt=\"images/download/attachments/30083196/cvs_install.jpg\" class=\"confluence-embedded-image image-left\">\n        </img></p>\n            </td>\n        </tr>\n</tbody>        </table>\n            </div>\n</li><li class=\" \">    <p>Select the CVS plugin and follow the wizard&apos;s &apos;Next&apos; or &apos;Finish&apos; to complete the installation.    </p>\n</li></ul>    <div class=\"section section-3 \" id=\"src-30083196_CVS-EclipseCVSFunctionality\">\n        <h3 class=\"heading \"><span>Eclipse CVS Functionality</span></h3>\n<ul class=\" \"><li class=\" \">    <p>Browser remote repository    </p>\n</li><li class=\" \">    <p>Share project to the repository and checkout projects from the repository    </p>\n</li><li class=\" \">    <p>Synchronize project to see incoming and outgoing changes    </p>\n</li><li class=\" \">    <p>Commit, update and reverse changes    </p>\n</li><li class=\" \">    <p>See resource change history    </p>\n</li><li class=\" \">    <p>Merge changes    </p>\n</li></ul>    </div>\n    </div>\n    <div class=\"section section-2 \" id=\"src-30083196_CVS-ImportorCheckoutanCVSRespository\">\n        <h2 class=\"heading \"><span>Import or Checkout an CVS Respository</span></h2>\n<ol class=\" \"><li class=\" \">    <p>Go to <strong class=\" \">File</strong>-&gt;<strong class=\" \">Import</strong>    </p>\n</li><li class=\" \">    <p>Expand <strong class=\" \">CVS</strong>    </p>\n</li><li class=\" \">    <p>Select Checkout Projects from CVS.    </p>\n</li><li class=\" \">    <p>Complete Wizard with your CVS repository details.    </p>\n</li></ol>    <div class=\"section section-3 \" id=\"src-30083196_CVS-UtilizetheCVSPerspective\">\n        <h3 class=\"heading \"><span>Utilize the CVS Perspective</span></h3>\n<ol class=\" \"><li class=\" \">    <p>Go to <strong class=\" \">Window</strong> -&gt; <strong class=\" \">Open Perspective...</strong> -&gt; <strong class=\" \">Other</strong>.    </p>\n</li><li class=\" \">    <p>Select <strong class=\" \">CVS Respository Exploring</strong>    </p>\n</li></ol>    </div>\n    <div class=\"section section-3 \" id=\"src-30083196_CVS-AdditionalCVSQuestions\">\n        <h3 class=\"heading \"><span>Additional CVS Questions</span></h3>\n    <p>For advanced questions, we recommend checking out the <a class=\"external-link external-link\" href=\"http://wiki.eclipse.org/index.php/CVS_FAQ\" target=\"_blank\">CVS FAQ </a>    </p>\n    </div>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=30083196\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"CVS"});